import React from 'react';

import './global.css';

import Header from './pages/Header';
import Form from './pages/Form';
import Main from './pages/Main';

export default function App() {
  const hello = 'hello world!';
  return (
    <>
      <Header />
      <Form />
      <Main value={hello}/>
    </>
  );
}
